import axios from 'axios'

export const login = (data) => {
    return async (dispatch) => {
      const response = await axios.post(
        "https://eyedentity-socialmedia.herokuapp.com/users/login",
        data
      );
      console.log(response);

      dispatch({
        type: "USER_LOGI",
        payload: response.data.data,
      });
    };
  };
